import React from "react";

function LanguageCard() {
  return (
    <div className="card language-card">
      <span className="card-headline">Languages:</span>
      <ul className="language-list">
        <li>English</li>
        <li>German (just basics)</li>
      </ul>
    </div>
  );
}

export default LanguageCard;
